desktopweb.customCSS:
.kwt100.switch.sknSwitchActiveDisabled
{
    background: #ffffff !important;
    height: 20px !important;
    width: 36px!important;
    border-radius: 40px !important;
    border: 1px solid #d7d9e0 !important;
    cursor:not-allowed !important;
}

.sknSwitchActiveDisabledon{
    width: 22px !important;
    min-height: 25px !important;
   color:transparent !important;
  transform: translate3d(px, 0px, 0px);
  margin-right:0px!important;
  cursor:not-allowed !important;
}
.sknSwitchActiveDisabled .thumb{
  border: 0px !important;
    border-radius: 60px !important;
}

.sknSwitchActiveDisabled .thumb > span{
    min-height: 18px !important;
    width: 20px !important;
    margin-left: -8px;
    border-radius: 30px!important;
    background-image: none !important;
    background: #d7d9e0 !important;
}
.sknSwitchActiveDisabledoff{
    width: 22px !important;
    min-height: 25px !important;
    background: #d4d5dd;
    color:transparent !important;
    margin-left: -4px!important;
   cursor:not-allowed !important;
}

